3	Privacy policy	<h3> <strong>Privacy Policy</strong></h3><p><br>Effective Date: July 20, 2025<br><br>Thank you for using Travelblzr. This Privacy Policy explains how we collect, use, disclose, and protect your personal information when you use Travelblzr. Your privacy is important to us, and we are committed to ensuring the security and confidentiality of your information. By using Travelblzr, you consent to the practices described in this Privacy Policy.<br><br>Information We Collect<br>1.1 Personal Information:<br>We may collect personal information that you provide to us when you register for an account, such as your name, email address, profile picture, and any other information you choose to share with us.<br><br>1.2 User-Generated Content:<br>Travelblzr allows you to create and share content, such as photos, videos, and comments. Any content that you voluntarily provide through the App may be collected and stored by us.<br><br>1.3 Usage Information:<br>We may collect information about your use of Travelblzr, such as your device information, IP address, browser type, operating system, and mobile network information. This information is collected through the use of cookies and similar technologies.<br><br>Use of Information<br>2.1 Provide and Improve the App:<br>We use the information we collect to provide and improve Travelblzr, customize your user experience, and develop new features and functionalities.<br><br>2.2 Communication:<br>We may use your contact information to communicate with you about your account, respond to your inquiries, provide updates and notifications, and send promotional materials.<br><br>2.3 Analytics and Aggregated Data:<br>We may use your information to analyze App usage patterns, monitor trends, and gather demographic information. This data is anonymized and aggregated to help us understand and improve Travelblzr.<br><br>Information Sharing<br>3.1 Service Providers:<br>We may share your information with third-party service providers who assist us in operating Travelblzr, such as hosting providers, customer support services, and analytics providers. These service providers are bound by confidentiality obligations and are only authorized to use your information to provide services to us.<br><br>3.2 Compliance with Law:<br>We may disclose your information if required to do so by law or in response to a valid legal request, such as a court order or government investigation.<br><br>3.3 Business Transfers:<br>In the event of a merger, acquisition, or sale of all or a portion of our assets, your information may be transferred to the acquiring entity as part of the transaction. We will notify you of any such transfer and provide you with choices regarding your information.<br><br>Data Security<br>We take reasonable measures to protect the security and integrity of your information. However, please note that no method of transmission over the internet or electronic storage is completely secure, and we cannot guarantee absolute security.<br><br>Children's Privacy<br>Travelblzr is not intended for use by children under the age of 18. We do not knowingly collect personal information from children. If you believe that we have inadvertently collected information from a child, please contact us, and we will promptly delete the information.<br><br>Your Choices and Rights<br>You have certain choices and rights regarding the personal information we collect about you. You can update your account information and preferences through the App's settings. You can also request access to your personal information, ask us to correct any inaccuracies, or request deletion of your information by contacting us.<br><br>Third-Party Links and Services<br>Travelblzr may contain links to third-party websites or services. We are not responsible for the privacy practices or content of these third parties. We encourage you to review the privacy policies of those third parties before providing any personal information.<br><br>Updates to this Privacy Policy<br>We may update this Privacy Policy from time to time. The updated version will be posted on Travelblzr, and the effective date will be indicated at the top of the policy.<br><br><br>International Data Transfers<br>If you are accessing Travelblzr from outside the country where our servers are located, your personal information may be transferred to, stored, and processed in the country where our servers are located or in other jurisdictions. By using Travelblzr, you consent to the transfer, storage, and processing of your personal information in these locations.<br><br>Consent to Marketing Communications<br>By using Travelblzr, you consent to receive marketing communications from us or our partners regarding products, services, promotions, and events that may be of interest to you. You can opt-out of receiving these communications by following the unsubscribe instructions provided in the communication or by contacting us.<br><br>Cookies and Tracking Technologies<br>We use cookies and similar tracking technologies to collect and store certain information about your interactions with Travelblzr. Cookies are small text files that are stored on your device. You can manage your cookie preferences through your browser settings.<br><br>California Privacy Rights<br>If you are a California resident, you may have certain rights under the California Consumer Privacy Act (CCPA) regarding your personal information. To exercise your rights, such as the right to know, access, and delete your personal information, please contact us.<br><br>Please note that this Privacy Policy does not create any contractual or legal rights between you and Travelblzr. It is provided for informational purposes only and is subject to change without notice. We encourage you to review this Privacy Policy periodically for any updates or changes.<br><br>Severability<br>If any provision of this Privacy Policy is found to be invalid, illegal, or unenforceable, the remaining provisions shall continue to be valid and enforceable to the fullest extent permitted by law.<br><br>Entire Agreement<br>This Privacy Policy constitutes the entire agreement between you and Travelblzr regarding the collection, use, disclosure, and protection of your personal information. Any prior agreements, representations, or understandings regarding the same are hereby superseded.<br><br>Updates to this Privacy Policy<br>We may update this Privacy Policy from time to time to reflect changes in our practices or applicable laws. The updated Privacy Policy will be posted on Travelblzr, and the revised effective date will be indicated at the top of the policy. By continuing to use Travelblzr after the effective date, you acknowledge and agree to the updated Privacy Policy.<br><br>Third-Party Advertising<br>Travelblzr may feature advertisements from third-party advertisers. These advertisers may collect information about your interactions with their advertisements. We are not responsible for the privacy practices of these advertisers. We encourage you to review the privacy policies of these third parties for more information on their data collection and usage practices.<br><br>Social Media Integration<br>Travelblzr may offer integration with social media platforms, allowing you to share content or log in using your social media accounts. If you choose to connect your social media account, please be aware that the social media platform's privacy policy will govern the collection, use, and disclosure of your information by that platform. We encourage you to review the privacy policies of the respective social media platforms.<br><br>Changes to the App<br>We reserve the right to modify or discontinue Travelblzr, or any part thereof, with or without notice. We shall not be liable to you or any third party for any modification, suspension, or discontinuation of Travelblzr.<br><br>Feedback<br>We welcome your feedback, comments, and suggestions regarding Travelblzr and services. If you choose to provide feedback, you agree that we may use your feedback without any obligation to compensate you. Any feedback you provide will be deemed non-confidential and non-proprietary.<br><br>Language<br>In the event of any discrepancy between the English version of this Privacy Policy and any translated versions, the English version shall prevail.</p><p>Headings<br>The headings used in this Privacy Policy are included for convenience only and shall not affect the interpretation or enforceability of the provisions herein.<br><br>Effective Date<br>This Privacy Policy is effective as of the date indicated at the top of the policy and applies to all users of Travelblzr from that date onward.<br><br>Consent Withdrawal<br>You have the right to withdraw your consent to the collection, use, and disclosure of your personal information as outlined in this Privacy Policy. To do so, please contact us using the provided contact information. However, please note that withdrawing consent may result in the inability to access certain features or services offered by the App.<br><br>Survival<br>The provisions of this Privacy Policy that, by their nature, are intended to survive termination or expiration, including but not limited to provisions related to data security, dispute resolution, and limitation of liability, shall survive any termination or expiration of this Privacy Policy.<br><br>Interpretation<br>If any provision of this Privacy Policy is held to be invalid or unenforceable, such provision shall be severed from the remaining provisions, which shall continue to be valid and enforceable to the fullest extent permitted by law.</p><p>&nbsp;</p><p>Contact Us<br>If you have any questions, concerns, or requests regarding this Privacy Policy or our privacy practices, please contact us at Help@travelblzr.com.</p><p>&nbsp;</p><p>Thank you for reviewing our comprehensive Privacy Policy. We are committed to protecting your privacy and ensuring a safe and enjoyable experience while using Travelblzr. If you have any questions or concerns regarding this Privacy Policy or our privacy practices, please do not hesitate to contact us using the provided contact information.</p><p>&nbsp;</p><p>We strive to address all privacy-related inquiries and resolve any concerns in a timely and efficient manner.<br><br>Thank you for your trust in Travelblzr. We value your privacy and are committed to protecting your personal information in accordance with this Privacy Policy.</p>	Published	2025-03-10 02:33:48	2025-07-20 15:28:42
