66	France	2025-04-26 01:03:31	2025-07-07 11:07:18	1	+33	1751886438686baa664e937.png	France, officially known as the French Republic (Rpublique franaise), is a country located in Western Europe. It is one of the most influential countries in the world, known for its rich history, culture, art, fashion, and cuisine. France has a diverse geography, from the Alps and Pyrenees mountains to beautiful Mediterranean beaches and rolling vineyards.	FR
14	Armenia	2025-04-26 01:03:31	2025-07-20 15:12:32	1	+374	\N	With its ancient monasteries, stunning mountain scenery, and rich history as one of the world's oldest civilizations, Armenia attracts those interested in culture and history. Visitors explore sites like the Geghard Monastery and the Temple of Garni, hike in the Caucasus Mountains, and experience traditional Armenian hospitality. The country's unique cultural heritage and beautiful landscapes are key draws for tourists.	AM
7	Afghanistan	2025-04-26 01:03:31	2025-07-20 15:06:55	1	+93	\N	Known for its rugged mountains, ancient history, and the Silk Road's influence, Afghanistan has faced many conflicts. People are drawn to its stunning landscapes, including the Hindu Kush mountains and the ancient city of Bamiyan, despite ongoing challenges. Visitors seek to understand its rich cultural heritage and witness the resilience of its people.	AF
8	Albania	2025-04-26 01:03:31	2025-07-20 15:07:42	1	+355	\N	With its stunning Albanian Alps, beautiful beaches along the Ionian and Adriatic Seas, and historic sites like Butrint, Albania is a hidden gem in Europe. Tourists explore ancient ruins, hike through picturesque mountains, and relax on pristine coastlines. The country's unique blend of natural beauty and historical significance attracts those seeking off-the-beaten-path adventures.	AL
9	Algeria	2025-04-26 01:03:31	2025-07-20 15:08:47	1	+213	\N	Algeria boasts diverse landscapes, from the Sahara Desert to the Mediterranean coast. It is known for its ancient Roman ruins, including Tipasa and Djemila, and its rich cultural heritage. Visitors explore the vast Sahara, discover coastal cities like Algiers, and delve into the country's fascinating history.	DZ
10	Andorra	2025-04-26 01:03:31	2025-07-20 15:09:38	1	+376	\N	Nestled high in the Pyrenees mountains between France and Spain, Andorra is known for its stunning scenery, ski resorts, and status as a tax haven. People visit for winter sports, hiking in the summer, and duty-free shopping. The country's beautiful landscapes and unique cultural blend attract those seeking relaxation and outdoor activities.	AD
11	Angola	2025-04-26 01:03:31	2025-07-20 15:10:21	1	+244	\N	With its diverse landscapes, including rainforests, savannahs, and a long Atlantic coastline, Angola is known for its natural resources and cultural diversity. Visitors explore national parks like Kissama, experience vibrant cultural traditions, and discover the country's growing cities. Angola's potential for ecotourism and its rich cultural heritage are attracting increasing interest.	AO
