15	Australia	2025-04-26 01:03:31	2025-07-20 15:13:32	1	+61	\N	Known for its unique wildlife, vast Outback, iconic cities like Sydney and Melbourne, and stunning natural wonders like the Great Barrier Reef, Australia offers diverse experiences. People visit to explore vibrant cities, dive or snorkel in the reef, hike in national parks, and experience Aboriginal culture. The country's diverse attractions and natural beauty make it a popular destination for adventurers and nature lovers.	AU
16	Austria	2025-04-26 01:03:31	2025-07-20 15:14:03	1	+43	\N	The birthplace of Mozart and known for its stunning Alpine scenery, imperial history, and musical heritage, Austria attracts culture enthusiasts and outdoor adventurers. Visitors explore historic cities like Vienna and Salzburg, ski in world-class resorts, and hike in the Alps. The country's rich cultural heritage and beautiful landscapes make it a popular destination year-round.	AT
17	Azerbaijan	2025-04-26 01:03:31	2025-07-20 15:14:37	1	+994	\N	Known as the "Land of Fire," Azerbaijan boasts a unique blend of Eastern and Western cultures, modern architecture in Baku, and historical sites along the Silk Road. Visitors explore the ancient city of Baku, discover mud volcanoes and fire temples, and experience the country's diverse landscapes. Azerbaijan's unique cultural mix and modern developments attract those seeking new and interesting destinations.	AZ
