21	Barbados	2025-04-26 01:03:31	2025-07-20 15:18:11	1	+1246	\N	This Caribbean island is famous for its beautiful beaches, rum distilleries, and vibrant culture. People visit to relax on pristine shores, enjoy water sports, explore historic sites, and experience the island's lively music and nightlife. Barbados' stunning natural beauty and rich cultural heritage make it a popular tourist destination.	BB
22	Belarus	2025-04-26 01:03:31	2025-07-20 15:19:05	1	+375	\N	Known for its forests, lakes, and Soviet-era architecture, Belarus offers a glimpse into Eastern European history. Visitors explore national parks, discover historic castles, and experience the capital city of Minsk. The country's unique blend of natural beauty and historical significance attracts those seeking off-the-beaten-path destinations.	BY
